        />\n </properties>\n </persistence-unit>\n </persistence>\n ```\n can be translated
        to:\n ```\n quarkus.datasource.jdbc.url=jdbc:h2:mem:tasks-jsf-quickstart;DB_CLOSE_ON_EXIT=FALSE;DB_CLOSE_DELAY=-1\n
